  return (
    <div className='tradeBox'>
      <div className='tradeBoxHeader'>
        <h4>Swap</h4>
        <Popover title="Settings" trigger="click" placement='Bottam'>
          <SettingOutlined className='cog'/>
        </Popover>
      </div>
    </div>
  )
}

export default Swap
